import React, { useState } from "react";

function Contact() {
  const [name, setName] = useState("");
  return (
    <div className="flex my-5 mx-auto align-center justify-center text-center">
      <h1>Contact me</h1>
      <h3>
        Ask questions, work with me, hire me, leave suggestions, leave
        compliments, insult me if you wish (no hard feelings)
      </h3>
      <div>
        <form>
          <label>
            Enter name:
            <input
              onChange={(e) => setName(e.target.value)}
              type="text"
              value={name}
            />
          </label>
        </form>
      </div>
    </div>
  );
}

export default Contact;
